  [input1, setInput1] = useState('')
  [input2, setInput2] = useState('')


  const handleNewspaperSubmit = (e) => {
    e.preventDefault();
  }
  return (
    <>
    <h1 className='componentInfo'>Add Newspaper</h1>
      <Addnewspaper
       newNewspaper={newNewspaper}
       setNewNewspaper={setNewNewspaper}
       handleNewspaperSubmit={handleNewspaperSubmit}
      />
      <Table/>
    </>
  )
}

export default Newspaper
